    "Weight": 2,
    "Description": "Waterproof industrial grade case with built-in screen protector and Kensington lock compatibility<br>&lt;!-- split --&gt;<br>The aXtion Pro M Case for the Surface Pro 6 | 5 | 4 is designed to provide unparalleled protection in the most unpredictable environments. From oil rigs to medical clinics, this case maintains the longevity of your tablet while on the job.&nbsp;<br><br>This rugged case is military-grade shockproof certified (MIL-STD-810G) and waterproof with an IP68 rating. This case maintains access to the auxiliary, USB, and charging ports and volume and power buttons. This sturdy case is built to protect your tablet against water, dust, sand, and any other external particles. For extended usage, this case features built-in heat-dissipating technology. The case can be tethered using a cable lock attached to an immovable object, making this case ideal for public spaces.<br><br>Built with MagConnect technology, this industrial grade case is also compatible with any MagConnect mount. You can also remove the MagConnect mounting plate, making the case compatible with any VESA 100 mounting system via the four available screw holes. To increase mobility, optional accessories include the Universal Carrying Handle and Shoulder Strap.<br>&lt;!-- split --&gt;<br><ul><li>Compatible with Surface Pro 6 | 5 | 4</li><li>Case has IP68 waterproof rating and is military-grade shockproof certified (MIL-STD-810G)&nbsp;</li><li>Compatible with Kensington Cable Lock for increased security against tablet theft</li><li>Built-in heavy duty screen protector and port and button covers</li><li>Heat dissipating technology to increase airflow within case and reduce overheating</li><li>Built with MagConnect technology for easy mount and dismount to any MagConnect mount</li><li>Case has removable mounting plate to allow mounting to any VESA 100 mounting system via 4 screws</li><li>Maximize mobility with these optional accessories: Universal Carrying Handle and Shoulder Strap<br></li></ul><br>&lt;!-- split --&gt;<br>Case Specifications&nbsp;<br>Dimensions: 13.12\" X 9.71\" X 0.87\"&nbsp;<br>Weight: 1.53 lbs.<br>Waterproof Rating: IP68&nbsp;<br>Shockproof Rating: MIL-STD-810G<br>Compatible Models: Microsoft Surface Pro 6 | Surface Pro 5 | Surface Pro 4<br><br><a href=\"https://youtu.be/rakQprPBz2s\" target=\"_self\"><font color=\"#ff0000\">PRODUCT VIDEO</font></a><br><p>Product Features<br>1. Security Lock Port<br>2. Front and Rear Facing Camera Lens Covers<br>3. MagConnect Mount Adapter<br>4. VESA 100 Compatible<br>5. Molded-In Buttons<br>6. Universal Shoulder Strap Port<br>7. Headphone Jack Cover<br>8. Built-In Heavy-Duty Screen Protector<br>9. Port Covers</p>",
