    "Weight": 2,
    "Description": "Antimicrobial healthcare grade, waterproof and rugged case featuring MagConnect compatibility and a built-in rotating module with hand strap and non-slip kickstand<br>&lt;!-- split --&gt;<br>The aXtion Pro MPA for Surface Go 3 | Go 2 | Go is specially designed to create a multi-purpose tablet solution for the healthcare industry. This military-grade certified and waterproof case is infused with IonPure<sup>รยฎ</sup>, an antimicrobial agent, to help prevent against bacteria and mold growth. This revolutionary case is compatible with medical-grade wipes to uphold the safety regulations of healthcare and hospital environments.<br><br>This fully enclosed case features ThermoDefend, our new proprietary heat dissipating technology, to maintain device performance. The case easily latches to enclose the Surface device and includes built-in antimicrobial screen and camera lens protectors. The built-in aXtion VESA MPA module includes the silicone hand strap, MagConnect plate, and rotating multi-angle kickstand. Designed for easy use, the kickstand can be rotated and adjusted to a wide range of angles and features a non-slip finish to guard surfaces against scratches.<br>&lt;!-- split --&gt;<br><ul><li>Compatible with Surface Go3 | Go 2 | Go</li><li>Infused with antimicrobial IonPure<span style=\"font-size: 13.3333px;\">รยฎ</span>&nbsp;agent to prevent against bacteria and mold growth</li><li>Military-grade shockproof (MIL-STD-810G) and waterproof (IP68) certified</li><li>ThermoDefend heat-dissipating proprietary technology to maintain device performance</li><li>Protective features include: built-in heavy duty screen and camera lens protectors; port and button covers; security lock slot</li><li>Antimicrobial aXtion VESA MPA Module with a MagConnect plate, adjustable hand strap, and rotating kickstand for multi-angle display and positioning</li><li>Hands-free mobility with optional Universal Shoulder Strap<br></li></ul><br>&lt;!-- split --&gt;<br>Case Specifications&nbsp;<br>Dimensions: 8.69\" x 10.72\" x 2\"<br>Weight: 1.55 lbs.<br>Waterproof Rating: IP68&nbsp;<br>Shockproof Rating: MIL-STD-810G<br>Compatible Models: Microsoft Surface Go 3 | Surface Go 2 | Surface Go<br><br><a href=\"https://youtu.be/jgxi3BRSXdo\"><span style=\"color:#c0392b;\">Unboxing Video</span></a><p>Case Features<br>1. IonPure<sup>รยฎ</sup> Antimicrobial Additive Agent<br>2. ThermoDefend&nbsp;Heat Dissipating Technology Pad<br>3. Silicone, Adjustable Hand Strap<br>4. Rotating Multi-Angle and Non-Slip Kickstand | Carrying and Hanging Handle<br>5. MagConnect Mount Adapter<br>6. VESA 100 Compatible<br>7. Universal Shoulder Strap Port<br>8. Port and Headphone Jack Cover<br>9. Built-In Heavy-Duty Screen Protector with Antimicrobial Coating<br>10. Front and Rear Facing Camera Lens Covers<br>11. Security Lock Port<br>12. Molded-In Buttons</p>",
