    "Weight": 23,
    "Description": "White floor stand kiosk with secure enclosure featuring security cable lock compatibility<br>&lt;!-- split --&gt;<br>This turn key kiosk solution is designed for Surface Pro 8. This floor stand kiosk solution is an ideal solution that provides guests with contactless engagement for a magnitude of use-cases. This kiosk is suitable for public spaces such as retail shops, reception areas, and even manufacturing facilities. Features include: cable management to allow tablet charging without cables handing from the device; key lock port which secures the device in public spaces; weighed base to ensure the kiosk won't slide or tilt; camera access for application enablement; fully enclosed blocking all access points to ports and buttons; and VESA 50 | 75 | 100 compatibility.&nbsp;<br><br>Tablet security is a top priority when displaying a tablet in public spaces; this kiosk has a lock slot that is compatible with our LockDown cable locks, which can be tethered to an immovable object. Optional accessories to pair with this kiosk include a tilt and rotate module which ensures ADA compliance. This kiosk solution is also available in black.&nbsp;<br>&lt;!-- split --&gt;<br><ul><li>Designed for Surface Pro 8</li><li>Kiosk's body is designed for cable management</li><li>Slim and minimalistic profile to display tablet with front camera accessibility</li><li>Enclosure has built-in key lock feature to securely display tablet</li><li>Built-in slot compatible with Kensington cable locks to tether the entire kiosk</li><li>Compatible with VESA 50mm, 75mm, and 100mm</li><li>Optional accessories include acrylic graphic panel and a tilt/rotate module</li></ul><br>&lt;!-- split --&gt;<br>Kiosk Specifications<br>Height: 45\"<br>Viewing Angle: 45 degrees<br>Base Diameter: 15.25\"<br>Compatibility: VESA 50mm, 75mm and 100mm<br>Compatible Models: Microsoft Surface Pro 8<br><BR>Enclosure Specifications&nbsp;<br>Thickness: 0.8\"<br>Height: 9.5\"<BR>Width: 14",
