    "Weight": 1.32,
    "Description": "Military-grade certified, water-resistant, rugged case with MagConnect compatibility, built-in hand strap, and kickstand<br>&lt;!-- split --&gt;<br>The aXtion Bold MP is a splash-proof and rugged case for iPad 10.2\" 9th (2021) | 8th | 7th Gen. It is military-grade certified shockproof holding a MIL-STD-810H certification. Other protective features include: heavy-duty screen and camera lens protectors built to protect your devices from accidental scratches; port and button covers to ensure dust and debris doesn't enter the device's crevices; and reinforced corners to help absorb shock in case of accidental drops. Further case attributes include: a rotating hand strap made of silicone for easy cleaning; a pivoting and multi-angle kickstand; and Touch ID and ambient light sensor support.<br><br>This unique case is compatible with any of our MagConnect mounts. With a wide range of mount configurations there is undoubtedly one that is suitable to fit your needs. These mounts enable operators to work hands-free. To expand on this mobility the case can be paired with an optional Universal Shoulder Strap.<br>&lt;!-- split --&gt;<br><ul><li>Compatible with iPad 10.2\" 9th | 8th | 7th Gen</li><li>Shockproof with military MIL-STD-810H certified (Shockproof with reinforced corners)</li><li>Compatible with Apple Pencil 1st Gen</li><li>Built-in, replaceable heavy-duty screen protector</li><li>Built-in 360-degree rotating hand strap and kickstand</li><li>Supports typing and viewing modes for both landscape and portrait orientation&nbsp;</li><li>Supports Universal Shoulder Strap (sold separately)</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications<br>Dimensions: 7.76\" x 10.67\" x 1.68\"<br>Weight: 1 lb<br>Shockproof Rating: Military Grade Shockproof Standard (MIL-STD-810H)<br>Compatible Models: Apple iPad (9th Generation) A2602, A2604, A2603, A2605 | iPad (8th Generation) A2270, A2428, A2429, A2430 | iPad (7th Generation) A2197, A2200, A2198<br><br><a href=\"https://support.apple.com/en-us/HT201471\" target=\"_blank\"><font color=\"#d0103a\">How to identify your iPad model number</font></a><br><br>Case Features<br>1. Accessories port for optional shoulder strap (CWX202)<br>2. MIL-STD-810H Drop-proof certification with reinforced corners<br>3. MagConnect adapter for compatibility with all MagConnect mounts<br>4. Rotation lock for usage on a mount<br>5. Rotating, easy-to-clean, adjustable, silicone hand strap<br>6. Rotating, multi-angle, slide out kickstand<br>7. Port covers<br>8. Apple Pencil holder<br>9. Built-in screen protector<br>10. Molded-in buttons<br>11. Ambient light sensor compatibility<br>12. Rear facing camera lens cover",
