    "Description": "Lockable, military-grade certified, water-resistant, rugged case with MagConnect compatibility, with built-in rotating hand strap, and kickstand<br>&lt;!-- split --&gt;<br>The aXtion Bold MPS is a rugged and lockable case for iPad 10.2\" 9th | 8th | 7th Gen. It features military-grade certified shockproof holding a MIL-STD-810H certification in addition it is water-resistant. Other protective features include: anti-theft security locking plate for use in public spaces; heavy-duty screen and camera lens protectors built to protect your devices from accidental scratches; port and button covers to ensure dust and debris doesn't enter the device's crevices; and reinforced corners to help absorb shock in case of accidental drops. The case also features a rotating easy to clean silicone hand strap and a multi-angle kickstand.&nbsp; &nbsp;<br /><br />This case allows you to seamlessly pair and charge an Apple Pencil 2nd Gen via the built-in stylus holder. This unique case is compatible with any of our MagConnect mounts. With a wide range of mount configurations there is undoubtedly one that is suitable to fit your needs. These mounts enable operators to work hands-free. To expand on this mobility the case can be paired with an optional Universal Shoulder Strap.<br>&lt;!-- split --&gt;<br><ul><li>Compatible with iPad 10.2\" 9th&nbsp;| 8th | 7th Gen</li><li>Features a built-in security locking plate, compatible with Kensington locks</li><li>Shockproof with military MIL-STD-810H certified (Shockproof with reinforced corners)</li><li>Compatible with Apple Pencil 2nd Gen pairing and charging technology</li><li>Built-in, replaceable heavy-duty screen protector</li><li>Built-in 360-degree rotating hand strap and kickstand</li><li>Supports typing and viewing modes for both landscape and portrait orientation&nbsp;</li><li>Supports Universal Shoulder Strap (sold separately)</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications<br>Dimensions: 7.76\" x 10.67\" x 1.68\"<br>Weight: 1.38 lb<br>Shockproof Rating: Military Grade Shockproof Standard (MIL-STD-810H)<br>Compatible Models: Apple iPad (9th Generation) A2602, A2604, A2603, A2605 | iPad (8th Generation) A2270, A2428, A2429, A2430 | iPad (7th Generation) A2197, A2200, A2198<br><br><a href=\"https://support.apple.com/en-us/HT201471\" target=\"_blank\"><font color=\"#d0103a\">How to identify your iPad model number</font></a><br><br>Case Features<br>1. Accessories port for optional shoulder strap (CWX202)<br>2. MIL-STD-810H Drop-proof certification with reinforced corners<br>3. Locking Port<br>4. MagConnect adapter for compatibility with all MagConnect mounts<br>5. Rotation lock for usage on a mount<br>6. Rotating, easy-to-clean, adjustable, silicone hand strap<br>7. Rotating, multi-angle, slide out kickstand<br>8. Port covers<br>9. Apple Pencil 2nd Gen holder with pairing and charging compatibility<br>10. Built-in screen protector<br>11. Molded-in buttons<br>12. Ambient light sensor compatibility<br>13. Rear facing camera lens cover",
