    "Weight": 1.75,
    "Description": "Hazardous Location Certified, Rugged and Waterproof Case with Certified Installation Service (iPad not included)<br>&lt;!-- split --&gt;<br>The aXtion Extreme MP is an economical solution to an Industrial PC. It is designed to protect its user, the tablet and the work environment from potential hazards in extreme workplaces. With top of the line certifications for hazardous areas this case is safe for extreme work environments like oil, gas, mining and manufacturing. Built with no compromises this aXtion Exteme MP Case for iPad 10.2\" 9th Gen is military-grade shockproof certified (MIL-STD-810H) and dust and waterproof (IP68). Because the case is waterproof it is the ideal solution for inclement weather. From the built-in heavy-duty screen protector to the port and button covers this case keeps users safe and connected.&nbsp;<br><br>The case is compatible with all MagConnect HD quick connect mounts. These ergonomic mounts allow mobile users to work hands-free on oil rigs or manufacturing production lines. The case is compatible with VESA 100 mounting systems and features; a rotating silicone hand strap, multi-angle kickstand, button, port and camera covers/protectors. To expand mobility it can be used with the Universal Shoulder Strap or Harness.&nbsp;<br>&lt;!-- split --&gt;<br><ul><li>Compatible with iPad 10.2\" 9th Generation</li><li>Made for hazardous location with Class I Div 2, Class II Div 2, Class III Div 1 &amp; 2, Groups A - D, F, G certifications, and ATEX Zone 2 Compliant</li><li>Case is built for hazardous areas in oil, gas, manufacturing, mining and the like</li><li>Military-grade shockproof (MIL-STD-810H) provides tablet protection ensuring the device stays in play</li><li>Waterproof IP68 rating enables submersion of the case for quick and easy cleaning</li><li>For hands-free usage the case can be paired with any MagConnect HD compatible mount; allowing the user to focus on the task at hand</li><li>Features include: screen protector, cable lock slot, button and port covers, rotating hand strap and kickstand</li><li>Maximize mobility with these optional accessories: Universal Shoulder Strap and Harness&nbsp;</li></ul><br>Disclaimer: The iPad is installed into the case by a technician in our certified installation centers. The hazardous location solution is verified with a seal. Removal of the iPad from the case voids certification.<br>&lt;!-- split --&gt;<br>Case Specifications<br>Dimensions: 11.27\" x 8.25\" x 2.5\"<br>Weight: 1.12 lbs.<br>Waterproof Rating: IP68<br>Shockproof Rating: MIL-STD-810H<br>Compatible Models:&nbsp;&nbsp;Apple iPad (9th Generation) A2602, A2604, A2603, A2605<br><br><a href=\"https://youtu.be/vBL19ffjGMs\"><span style=\"color:#c0392b;\">Unboxing Video</span></a><br><br><a href=\"https://support.apple.com/en-us/HT201471\" target=\"_blank\"><span style=\"color:#c0392b;\">How to identify your iPad model number</span></a><br><br>Case Features<br>1. Testing port with special tool access<br>2. Robust outer shell provides hazardous location protection with Class I Div 2, Class II Div 2, Class III Div 1 &amp; 2, Groups A - D, F, G certifications, and ATEX Zone 2<br>3. VESA 100 compatible<br>4. MagConnect adapter for compatibility with all MagConnect Mounts<br>5. Adjustable silicone hand strap - easy to clean<br>6. Rotating, multi-angle and anti-slip kickstand and carrying handle<br>7. Asset tag access<br>8. Universal Shoulder Strap port<br>9. Charging port cover<br>10. Touch ID compatibility<br>11. Built-in heavy-duty screen protector (9H PET)<br>12. Molded-In Buttons<br>13. Front and rear facing camera lens covers (9H PET)<br>14. Ambient light sensor compatibility<br>15. Security lock port",
