    "Description": "Universal, Adjustable Holder with locking and charging capabilities<br>&lt;!-- split --&gt;<br>The aXtion Volt Charging Cradle is made for tablets 8.1\" to 10\". This locking universal tablet holder is equipped with a security key lock and is ideal for shared workspaces like logistics, transportation and manufacturing. The cradle features quick release; with the click of a button, the device easily slides in and out of the cradle. The cradle works seamlessly with our HD Mounts via a 38mm rubber coated ball joint. The ball joint was designed with rubber coating to reduce friction and vibration and ensures a maximum holding capacity of a device up to 7 pounds. The ball joint also allows the user to reach their perfect viewing angle in either portrait or landscape modes.&nbsp;<br /><br />Our full line of HD Mounts position the device exactly where it is needed, giving mobile workers the freedom to complete tasks handsfree in virtual any work environment. The mounts feature rubber coated ball joints at the mount's base to allow the mount to be perfectly positioned. Other features include, cable management, easy adjustment, MIL-STD-810G-514.7 vibration testing certification, made with corrosion resistant material, and optional security screw.<br>&lt;!-- split --&gt;<br><ul><li>Compatible with devices 8.1\" - 10\"</li><li>Lockable key lock holder ideal for multiuser work environments</li><li>Charging capability with USBC power in&nbsp;</li><li>Features rubber coated spherical ball joints</li><li>Hold capacity of 7 lbs</li><li>Quick device install and removal with the click of a button</li><li>Adjusts to optimal viewing angle in both portrait and landscape modes</li></ul><br>&lt;!-- split --&gt;<br>Holder Specifications<br />Accommodates Tablet Physical Size: 5.45\" - 8.6\" (Width)&nbsp;<br />Accommodates Tablet Physical Size: 8.1\"- 10\" (Height)&nbsp;<br />Maximum Tablet Depth: 0.7\"&nbsp;<br />Product Weight: 0.76 lbs",
