    "Weight": 0.98,
    "Description": "Ultra-slim, Rugged and MagConnect compatible case with smoked transparent back featuring a silicone hand strap<br>&lt;!-- split --&gt;<br>The aXtion Slim MH is built for iPad 10.2\" 9th | 8th | 7th Generation. It is a rugged and waterproof case that features military grade certification (MIL-STD-810H) and a waterproof rating of IP68. The cases' slim profile allows it to easily fit into virtually any charging cart making it perfect for healthcare, education, retail and manufacturing settings. Additional protective features include: button and port covers, screen and camera lens protectors, and reinforced corners.&nbsp;<br><br>The case is compatible with all of our MagConnect quick connect mounts. These mounts enable quick mounting and dismounting via the mount's magnetic connection. A wide range of mount options are available that fit into virtually any environment; giving users the ability to work hands-free. For the mobile workforce the case features a hand strap and can be paired with our Universal Shoulder Strap to help streamline workflows for drive-through order taking.&nbsp;<br>&lt;!-- split --&gt;<br><ul><li>Compatible with iPad 10.2\" 9th | 8th | 7th Generation</li><li>Compatible with all MagConnect mounts</li><li>Military-grade (MIL-STD-810H) and waterproof (IP68) certifications</li><li>Easy to clean with approved sanitation wipes, see QSG, or quick submersion in a bath solution</li><li>Features include: built-in screen and camera lens protectors, port and button covers</li><li>Compatible with Apple Pencil 2nd Gen pairing and charging technology and Smart Keyboard</li><li>Slim profile perfect for charging carts</li><li>For mobile users the case has a hand strap and can be paired with an optional Universal Shoulder Strap</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications<br>Dimensions: 10.53\" x 7.62\" x 0.92\"<br>Weight: 0.64 lbs<br>Shockproof Rating: MIL-STD-810H<br>Waterproof Rating: IP68<br>Compatible Models: Apple iPad (9th Generation) A2602, A2604, A2603, A2605 | iPad (8th Generation) A2270, A2428, A2429, A2430 | iPad (7th Generation) A2197, A2200, A2198<br><br><a href=\"https://youtu.be/wv0gHSNZL0I\"><span style=\"color:#c0392b;\">Unboxing Video</span></a><br><br><a href=\"https://support.apple.com/en-us/HT201471\" target=\"_blank\"><font color=\"#d0103a\">How to identify your iPad model number</font></a><br><br>Case Specifications<br>1. Smoked transparent back with asset tag support<br>2. MagConnect adapter for compatibility with all MagConnect Mounts<br>3. Silicone Hand Strap can be easily cleaned<br>4. Port covers<br>5. Universal shoulder strap port<br>6. Built-in screen protector<br>7. Apple Pencil holder<br>8. Key Folio Support<br>9. Molded-in buttons<br>10. Front and rear camera lens protectors<br>11. Ambient light sensor compatibility<br>12. Headphone port access",
