    "Description": "Hazardous Location Certified, Rugged and Waterproof Case featuring NFC range extender, MagConnect compatibility and a built-in rotating module with hand strap and non-slip kickstand and Certified Installation Service (Surface Go not included)<br>&lt;!-- split --&gt;<br>The aXtion Extreme MP NFC case is specialized for hazardous environments. With certifications in Class I Div 2, Class II Div 2, Class III Div 1 &amp; 2, Group A-D, F, G, for Surface Go 3รยน with additional ATEX Zone 2 compliance for Surface Go 3รยฒ. This case protects from accidental ignition caused by flammable vapors, mist, dust and fibers. The case is an economic alternative to an industrial PC solution and is safe for extreme work environments like oil, gas, mining and manufacturing. The case is equipped with an NFC range extender providing accurate NFC scans every time. The case also features weatherproof protection thanks to the built in screen and camera lens protectors, button, and port covers.&nbsp;<br><br>Pairs with our MagConnect HD Mounts to create a handsfree ecosystem for any hazardous location. These ergonomic mounts give users the freedom to navigate their \"office\" no matter what that looks like. The case is compatible with VESA 100 mounting systems and features; a rotating silicone hand strap, and multi-angle kickstand.<br>&lt;!-- split --&gt;<br><ul><li>Designed for Surface Go 3</li><li>Hazardous location certified - See \"Specifications\" tab for more details</li><li>For hands-free usage the case can be paired with any MagConnect HD compatible mount; allowing the user to focus on the task at hand</li><li>Features include: NFC range extender ensuring a clear read with each scan, cable lock slot, button and port covers, hand strap and kickstand</li><li>Maximize mobility with these optional accessories: Universal Shoulder Strap and Harness</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications:<br>Dimensions: 8.69\" x 10.6\" x 2\"<br>Weight: 1.76 lbs.<br>Waterproof Rating: IP68&nbsp;<br>Shockproof Rating: MIL-STD-810H<br>รยฒATEX Zone 2 Compliance: Ex ic nc IIC T5 Gc -20รยฐC&lt;Tamb&lt; +40รยฐC, IP64 (Surface Go 3 models 1901, 1926, 2022)<br>รยนNA Compliance: Class I and Class II, Div. 2 &amp; Class III Div. 1 &amp; Div. 2, Groups A - D, F, G, T5, -20รยฐC to +40รยฐC, IP64 (Surface Go 3 models 1901, 1926, 2022)<br><br>Disclaimer: The final Surface and case solution is assembled, installed and certified with a seal by The Joy Factory. Tampering or removal of the seal voids both the certification and warranty.<br><br>Case Features:<br>1. Reinforced corners<br>2. Robust outer shell provides hazardous location protection<br>3. MagConnect adapter for compatibility with all MagConnect Mounts<br>4. Rotating, multi-angle and anti-slip kickstand and carrying handle<br>5. Adjustable silicone hand strap - easy to clean<br>6. VESA 100 Compatible<br>7. NFC range extender<br>8. Universal Shoulder Strap port<br>9. Charging port cover<br>10. Built-in heavy-duty screen protector<br>11. Front and rear facing camera lens covers<br>12. Security lock port<br>13. Molded-In Buttons",
