    "Description": "Ultra-slim rugged case with MagConnect compatibility and a built-in rotating module with adjustable silicone hand strap and non-slip kickstand/carrying handle<br>&lt;!-- split --&gt;<br>The aXtion Edge+ MP for Surface Pro 8 is a certified rugged case designed for industrial use. It protects the Surface Pro from accidental drops and features reinforced corners. The case expands usage while in the field with the built-in rotating hand strap and multi-angle kickstand/carrying handle. It is compatible with the Surface Type Cover and has straps to keep the cover in place when not in-use. For mobile users in construction, energy and utilities, logistics and transportation, manufacturing and oil and gas this lightweight case keeps the Surface Pro safe and accessible while on the go.<BR><br>The case pairs seamlessly with our MagConnect HD quick connect tablet mounting system. These heavy-duty mounts are available in multiple configurations and provide hand-free usage for virtually any work environment. To expand on mobility the case can be used with the Universal Shoulder Strap to provide hands-free mobility while on-the-go.<BR><br>&lt;!-- split --&gt;<br><ul><li>Designed for Surface Pro 8</li><li>Lightweight and rugged with reinforced corners for military grade shockproof certification (MIL-STD-810H)</li><li>Other protective features include; screen protector, button and port covers</li><li>Adjustable hand strap and rotating non-slip kickstand for multi-angle display and positioning</li><li>MagConnect compatible for quick and easy attachment and detachment with any MagConnect mount</li><li>Compatible with Surface Type Cover with straps at two corners to keep cover securely closed</li><li>Hands-free mobility with optional Universal Shoulder Strap</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications&nbsp;<br>Dimensions: 9.23\" x 12.3\" x 2.75\"<br>Weight: 0.9 lbs.<br>Shockproof Rating: Military Grade Shockproof Standard (MIL-STD-810H)&nbsp;<br>Compatible Models: Microsoft Surface Pro 8<p>Case Features:<br>1. Type Cover Straps<br>2. Camera Lens Covers<br>3. MagConnect Mount Adapter<br>4. Rotating and Adjustable Hand Strap<br>5. Rotating, Multi-Angle, Non-Slip Kickstand/Carrying/Hanging Handle<br>6. Clear Back for easy Asset Tag Access<br>7. Port Covers<br>8. Screen Protector (Front Cover)<br>9. Molded-In Button<br>10. Reinforced Corners<br>11. Universal Shoulder Strap Port</p>",
