    "Description": "Lockable military-grade certified, water-resistant, rugged case with MagConnect compatibility, built-in hand strap, and kickstand<br>&lt;!-- split --&gt;<br>The aXtion Bold MPS for iPad Air 5th | 4th Gen | Pro 11\" 4th | 3rd | 2nd Gen protects a business' tablet investment with its robust protective features. Whether walking the shop floor or working in the field, this rugged case is the dynamic solution to protecting your tablet while keeping a low profile. Features include; water-resistant, military-grade shockproof (MIL-STD-810H) certified, port covers, built-in replaceable screen protector, and front and back camera lens covers, rotating hand strap and kickstand. You can firmly secure your tablet to any surface with a high quality key cable lock that adheres to the device with 3M VHB adhesive.&nbsp;<br><br>The case is compatible with all MagConnect quick connect mounts. These ergonomic mounts position the device exactly where it is needed, giving users the freedom to work hands-free. Mount options include vehicle, forklift, round and flat surface mounts. They feature ball joints for near-infinite adjustment to help the user reach their perfect viewing and operational angle. To expand the hands-free usability, pair this case with our Universal Shoulder Strap.<br>&lt;!-- split --&gt;<br><ul><li>Compatible with iPad Air 5th | 4th Gen | iPad Pro 11\" 4th | 3rd | 2nd Gen</li><li>Shockproof with military MIL-STD-810H certified</li><li>Built-in security, which includes a locking plate and high quality key cable lock</li><li>Compatible with Apple Pencil 2nd Gen pairing and charging technology</li><li>Water-resistant case with built-in, heavy-duty screen protector and camera lens protectors</li><li>Built-in 360 rotation hand strap and kickstand</li><li>Supports landscape viewing mode &amp; landscape and portrait typing modes</li><li>Includes MagConnect mounting adapter, guaranteeing compatibility with MagConnect Mount System</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications<br>Dimensions: 7.8\" x 10.4\" x 0.9\"<br>Weight: 0.93 lbs.<br>Shockproof Rating: Military Grade Shockproof Standard (MIL-STD-810H)<br>Compatible Models: Apple iPad Air (5th Generation) A2588, A2589, A2591 | iPad Air (4th Generation) A2316, A2324, A2325, A2072 | iPad Pro 11\" (4th Generation)&nbsp;A2759, A2435, A2761, A2762 | iPad Pro 11\" (3rd Generation) A2377, A2459, A2301, A2460 | iPad Pro 11\" (2nd Generation) A2228, A2068, A2230, A2231<br><br>Case Features<br>1. Reinforced corners<br>2. Locking Port<br>3. Rotation lock for usage on a mount<br>4. MagConnect adapter for compatibility with all MagConnect Mounts<br>5. Easy to clean silicone rotating hand strap&nbsp;<br>6. Rotating 4-way kickstand<br>7. Port covers<br>8.&nbsp;Accessories port for optional shoulder strap (CWX202)<br>9. Apple Pencil 2nd Gen holder with pairing and charging compatibility<br>10. Built-in screen protector<br>11. Molded-in buttons<br>12. Rear facing camera lens cover<br>13. Ambient light sensor compatibility",
