    "Description": "Military-grade certified, lightweight, water-resistant, rugged case with belt clip harness and kickstand featuring MagSafe compatibility<br>&lt;!-- split --&gt;<br>The aXtion Go for iPhone 12 is a trusted solution to protect a workforce's phone investment. It is designed to protect the device from accidental drops and inclement weather like rain or dust storms. This case boasts MIL-STD-810H certification and has extra layers of shock protection. The silicone shock absorbers within the frame of the case do their job of absorbing shock waves before they reach the iPhone. Expanding on that protection, the case's corners have a reinforced design to absorb and disperse shock. In addition to these robust protective features, the case also has a screen protector, front and back camera lens covers, and button and port covers. Other protective features include raised edges around the screen and cameras to add extra screen protection, and textured edges around the case to provide extra grip.<br><br>The case includes a holder which features a rotating belt clip and slide out kickstand. The holster works to secure and protect the device while it is not in use, and positions it for easy viewing when it is. For seamless charging, the case is compatible with MagSafe and Qi wireless charging.<br>&lt;!-- split --&gt;<br><ul><li>Compatible with iPhone 12</li><li>Shockproof with MIL-STD-810H certification</li><li>Reinforced corners to absorb and divert shock</li><li>Compatible with Apple's MagSafe and Qi wireless charging</li><li>Built-in, heavy-duty, screen &amp; camera lens protectors</li><li>Includes a holster with a built-in rotating belt clip and slide out kickstand</li><li>Additional protective features include; button and port covers</li><li>Asset tag window compatibility</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications<br>Dimensions: 3.6\" x 6.5\" x 0.65\"<br>Weight: 0.175 lbs<br>Shockproof Rating: Military Grade Shockproof Standard (MIL-STD-810H)<br>Water Protection Rating: IP54<br>Compatible Models: Apple iPhone (12th Generation) A2172, A2402, A2403<br><br>Case Features<br>1. Reinforced corners to absorb and divert shock<br>2. Rear facing camera lens cover<br>3. Raised edges for extra lens and screen protection<br>4. Molded-in buttons<br>5. Robust outer shell provides hazardous location protection<br>6. 9H PET screen protector<br>7. Textured edges for extra grip<br>8. MagSafe and Qi wireless charging compatibility<br>9. Fully enclosed IP54 liquid and dust particle rating<br>10. Lightning connector cover<br>11. Accessory port for lanyard or carrying strap<br>12. Asset tag compatibility<br>13. Included holster with built-in belt clip and kickstand<br>14. Volume up/down button covers<br>15. Ring/Silent toggle switch<br>16. Ambient light sensor compatibility",
