    "Weight": 2,
    "Description": "Continuous charging and lockable holder with drill down/adhesive heavy duty mount built for high vibration in vehicles<br>&lt;!-- split --&gt;<br>This aXtion Volt Charging Cradle Bundle is paired with an HD Universal Adhesive Mount. This kit can be paired with an aXtion Volt tablet case for 8.1\" to 10\" tablets. The holder features continuous charging and a security lock, making it ideal for public workspaces in logistics, transportation and manufacturing. It features quick device removal; with the click of a button, the device easily slides in and out of the holder. This holder and mount pairing feature a 38mm rubber coated ball joint to reduce friction and vibration. It has a maximum holding capacity of up to 15 pounds. In addition, the ball joint allows for adjustments to reach the perfect viewing angle in either portrait and landscape modes.&nbsp;<br><br>The mount's base attaches to a flat or semi curved surface with either the industrial grade 3M VHB adhesive or can be drilled down using four screws. This semi-permanent application is great for virtually any vehicle dashboard. It is built with corrosion resistant and high quality materials, ensuring the mounts durability and longevity.&nbsp;<br><br>For more about tablet compatibility, click on \"Specifications\".<br>&lt;!-- split --&gt;<br><ul><li>Compatible with aXtion Volt cases 8.1-inch to 10-inch</li><li>Lockable key lock holder ideal for multiuser work environments&nbsp;</li><li>Semi-permanent installation onto any flat or near flat surface</li><li>Base attaches via industrial grade 3M VHB adhesive or included screws</li><li>Certified vibration and shock resistant MIL-STD-810G 514.6</li><li>Built with two 38mm spherical rubber coated ball joints to provide maximum holding strength&nbsp;</li><li>Made with corrosion-resistant material making it ideal for mixed element environments</li><li>Features cable management, 360 degree rotation, shock and vibration resistance, and near infinite adjustability</li></ul><br>&lt;!-- split --&gt;<br>Holder Specifications<br>Accommodates Tablet Physical Size: 5.45\" - 8.6\" (Width)&nbsp;<br>Accommodates Tablet Physical Size: 8.1\"- 10\" (Height)&nbsp;<br>Maximum Tablet Depth: 0.7\"&nbsp;<br>Product Weight: 0.76 lbs<br><br>Mount Specifications<br>Material: Aluminum Alloy &nbsp;<br>Weight: 1.51 lbs<br>Arm Length: 5.25\" x 1<br>Ball Joint Size: 38mm (1.5\")<br>Total Length: 7.75\"<br>Mount Load Capacity: Up to 15 lbs<br>Base Specifications: Affixes via 3M Industrial Grade VHB, or 4 screws, base diameter is 3.9",
