    "Description": "Universal, Adjustable Holder with syncing, charging and locking capabilities<br>&lt;!-- split --&gt;<br>The aXtion Volt Syncing and Charging Cradle is a universal tablet solution for 9.4-inch to 11.3-inch tablets. This syncing and charging cradle is lockable and features a key lock, making it ideal in shared workspaces. The cradle features quick release so that with just the touch of a button the tablet can be released. The cradle works with an aXtion Volt rugged case for tablets 9.4-inch to 11.3-inches. It has a maximum hold capacity of 7 pounds and features a 38mm spherical rubber coated ball joint. The cradle has been tested and certified for high vibration environments.<br><br>The cradle works seamlessly with our full line of HD Mounts that are designed to position the device exactly where it is needed, giving mobile workers the freedom to complete tasks hands-free in virtual any work environment. The mounts feature rubber coated ball joints at the mount's base to allow the mount to be perfectly positioned. Other features include, cable management, easy adjustment, MIL-STD-810G-514.7 vibration testing certification, made with corrosion resistant material, and optional security screw.<br>&lt;!-- split --&gt;<br><ul><li>Compatible with devices 9.4-inch to 11.3-inch&nbsp;</li><li>Lockable tablet holder is ideal for multiuser work environments&nbsp;</li><li>Charging capability with USBC power in&nbsp;</li><li>Features rubber coated spherical ball joints</li><li>Hold capacity of 7 lbs</li><li>Quick device install and removal with the click of a button</li><li>Adjusts to optimal viewing angle in both portrait and landscape modes</li></ul><br>&lt;!-- split --&gt;<br>Holder Specifications<br>Accommodates Tablet with Screen Size: 11\" - 12\" (Diagonal)&nbsp;<br>Accommodates Tablet Physical Size: 10\"- 13\" (Height)&nbsp;<br>Maximum Tablet Depth: 0.7\"&nbsp;<br>Product Weight: 0.75 lbs",
