    "Category String": "Product Type/Cases;Product Line/aXtion;All Products;aXtion Series/Pro;Features/Hand Strap Compatible;Features/Kickstand;Features/Rugged;Features/Screen Protector;Features/Shoulder Strap Compatible;Features/VESA Compatible;Features/Waterproof;Industry/Construction;Industry/Manufacturing;Industry/Energy & Utilities;Features/MIL-STD-810H;Device Type/iPad 10.9\" 10th Gen",
    "Weight": 1.5,
    "Description": "Industrial grade, rugged, waterproof case featuring MagConnect with rotating kickstand and hand strap<br>&lt;!-- split --&gt;<br>The aXtion Pro MP Case is an industrial grade, fully enclosed case designed to protect the iPad 10.9\" 10th Gen. This top of the line tablet case is suitable in a variety of environments including construction, manufacturing, and energy and utilities industries. Designed to withstand repeated drops, this case features military-grade shockproof certification (MIL-STD-810H) and has a waterproof rating of IP68. Other protective features include: screen and camera lens protectors to protect the device from scratches; button and port covers to keep dust and water out; and a robust otter shell to add extra shockproof protection against damage.&nbsp;&nbsp;<br><br>The case is compatible with all MagConnect HD quick connect mounts. These ergonomic mounts allow mobile users to work hands-free, giving them the freedom to focus on the task at hand. The case is compatible with VESA 100 mounting systems. To enhance the workflow for the mobile workforce, this case features a rotating silicone hand strap and multi-angle kickstand. To expand mobility, it can be used with the Universal Shoulder Strap.&nbsp;<br>&lt;!-- split --&gt;<br><ul><li>Compatible with iPad 10.9\" 10th Generation</li><li>Rugged case is military-grade shockproof certified (MIL-STD-810H) and waterproof with an IP68 rating&nbsp;</li><li>Case has a removable MagConnect mounting plate that allows for VESA 100 mounting system installation with 4 screws</li><li>MagConnect magnetic technology allows for easy and quick attachment and detachment to all MagConnect compatible mounts</li><li>Features include: screen protector, cable lock slot, button and port covers, rotating hand strap and kickstand</li><li>Maximize mobility with these optional accessories: Universal Shoulder Strap&nbsp;</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications&nbsp;<br>Dimensions: 11.27\" x 8.25\" x 2.5\"<br>Weight: 1.12 lbs.<br>Waterproof Rating: IP68<br>Shockproof Rating: MIL-STD-810H<br>Compatible Models: Apple iPad (10th Generation) A2696, A2757, A2777<br><br><a href=\"https://support.apple.com/en-us/HT201471\" target=\"_blank\"><font color=\"#d0103a\">How to identify your iPad model number</font></a><br><br>Case Features<br>1. Headphone port access<br>2. Robust outer shell provides industrial grade protection<br>3. Adjustable silicone hand strap - easy to clean<br>4. MagConnect adapter for compatibility with all MagConnect Mounts<br>5. Rotating, multi-angle and anti-slip kickstand and carrying handle<br>6. VESA 100 Compatible<br>7. Asset tag access<br>8. Universal Shoulder Strap port<br>9. Charging port access<br>10. Touch ID compatibility<br>11. Built-in heavy-duty screen protector<br>12. Molded-In Buttons<br>13. Front and rear facing camera lens covers<br>14. Ambient Light Sensor Compatible<br>15. Security lock port",
