    "Category String": "Product Type/Cases;Product Line/aXtion;All Products;aXtion Series/Bold;Features/Hand Strap Compatible;Features/Kickstand;Features/Lockable;Features/Rugged;Features/Screen Protector;Features/Shoulder Strap Compatible;Features/Weatherproof;Industry/Hospitality;Industry/Retail;Features/MIL-STD-810H;Device Type/iPad 10.9\" 10th Gen",
    "Weight": 2.14,
    "Description": "Lockable, military-grade certified, water-resistant, rugged case with MagConnect compatibility, with built-in rotating hand strap, and kickstand<br>&lt;!-- split --&gt;<br>The aXtion Bold MPS is a rugged and lockable case for iPad 10.9\" 10th Gen. It features military-grade certified shockproof holding a MIL-STD-810H certification in addition it is water-resistant. Other protective features include: anti-theft security locking plate for use in public spaces; heavy-duty screen and camera lens protectors built to protect your devices from accidental scratches; port and button covers to ensure dust and debris doesn't enter the devices crevices; and reinforced corners to help absorb shock in case of accidental drops. The case also features a rotating, easy to clean silicone hand strap and a multi-angle kickstand. &nbsp;&nbsp;<br><br>This unique case is compatible with any of our MagConnect mounts. With a wide range of mount configurations, there is undoubtedly one that is suitable to fit your needs. These mounts enable operators to work hands-free. To expand on this mobility, the case can be paired with an optional Universal Shoulder Strap.<br>&lt;!-- split --&gt;<br><ul><li>Compatible with iPad 10.9\" 10th Gen</li><li>Features a built-in security locking plate, compatible with Kensington locks</li><li>Shockproof with military MIL-STD-810H certified (Shockproof with reinforced corners)</li><li>Compatible with Apple Pencil 1st Gen</li><li>Built-in, replaceable heavy-duty screen protector</li><li>Built-in 360-degree rotating hand strap and kickstand</li><li>Supports typing and viewing modes for both landscape and portrait orientation&nbsp;</li><li>Supports Universal Shoulder Strap (sold separately)</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications<br>Dimensions: 7.76\" x 10.67\" x 1.68\"<br>Weight: 1.38 lbs<br>Shockproof Rating: Military Grade Shockproof Standard (MIL-STD-810H)<br>Compatible Models: Apple iPad (10th Generation) A2696, A2757, A2777<br><br><a href=\"http://support.apple.com/en-us/HT201471\"><span style=\"color:#e74c3c;\">How to identify your iPad model number</span></a><br><br>Case Features<br>1. Apple Pencil holder<br>2. Molded-in buttons<br>3. Rear facing camera lens cover<br>4. MagConnect adapter for compatibility with all MagConnect mounts<br>5. Rotating, easy-to-clean, adjustable, silicone hand strap<br>6. Security slot for security cable<br>7. Rotating, multi-angle, slide out kickstand<br>8. Port covers<br>9. Accessories port for optional shoulder strap (CWX202)<br>10. MIL-STD-810H Drop-proof certification with reinforced corners<br>11. Built-in screen protector<br>12. Ambient light sensor compatibility<br>13. Power button cover with Touch ID compatibility",
