    "Category String": "Product Type/Mount Bundles;Product Line/aXtion;All Products;Solution Type/Drill Down;Features/Lockable;Device Type/iPad Pro 11\" 2nd Gen;Industry/Construction;Industry/Logistics and Transportation;Industry/Energy & Utilities;Device Type/iPad Air 4th Gen;Device Type/iPad Pro 11\" 3rd Gen;Features/MIL-STD-810H;Mount Series/HD;aXtion Series/Volt;Features/IP54;Device Type/iPad Air 5th Gen;Device Type/iPad Pro 11\" 4th Gen",
