    "Weight": 2,
    "Description": "Charging and locking holder with locking capability paired with a heavy duty AMPs pattern mount<br>&lt;!-- split --&gt;<br>The aXtion Volt Charging Cradle with HD AMPs Drill Down Mount (38mm) works with the aXtion Volt case for iPad mini 6. This bundle includes the tablet holder paired with an HD AMPs Mount. The HD AMPs Mount is a multifaceted mounting solution that can be used to position a tablet in a multitude of vehicles such as fire trucks, ambulances or police cruisers. The mount features a robust drill-down universal AMPs base that can be attached to a solid surface like a vehicle dash or console. The mount is vibration resistant, making it ideal for virtually any vehicle.&nbsp;<br><br>This tablet holder features a key security lock and is ideal for public workspaces like logistics, transportation and manufacturing. It features quick device removal; with the click of a button, the device easily slides in and out of the holder. The mount features two 38mm rubber coated ball joints. The rubber coating reduces friction and vibrations as well as allows a maximum holding capacity of up to 7 pounds. The ball joints also allow for adjustments to reach the perfect viewing angle in either portrait and landscape modes.&nbsp;<br><br>For more about tablet compatibility, click on \"Specifications\".<br>&lt;!-- split --&gt;<br><ul><li>Compatible with iPad mini 6</li><li>Drill down base has an AMPs 30x38mm pattern for universal compatibility</li><li>Certified vibration, shock and drop resistant</li><li>Built with two 38mm spherical rubber coated ball joints to provide maximum holding strength&nbsp;</li><li>Made with corrosion-resistant material making it ideal for mixed element environments</li><li>Features cable management, 360 degree rotation, shock and vibration resistance, and near infinite adjustability</li><li>POGO Pin technology for quick and seamless placement of case onto any aXtion Volt Dock and Charge Station</li><li>Optional locking lever for usage in public spaces</li></ul><br>&lt;!-- split --&gt;<br>Case Specifications:<br>Dimensions: 8.6\" x 6\" x 0.65\"<br>Weight: 0.63 lbs<br>Shockproof Rating: MIL-STD-810H<br>Waterproof Rating: IP54<br>Compatible Models: Apple iPad mini (6th Generation) A2567, A2568, A2569<br><br>Mount Specifications:<br>Material: Aluminum Alloy &nbsp;<br>Weight: 1.51 lbs<br>Arm Length: 5.25\" x 1<br>Ball Joint Size: 38mm (1.5\")<br>Total Length: 7.75\"<br>Mount Load Capacity: Up to 15 lbs<br>Tablet Connection: Cradle<br>Base Specifications: Affixes via AMPs 30x38mm pattern",
